export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},wwrNdjZxuD:{data:{id:1575,attributes:{imdbId:"tt0122541",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTU3MTkyNTQxM15BMl5BanBnXkFtZTcwNDA2NTAyMQ@@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"6.8\u002F10"},{Source:"Rotten Tomatoes",Value:"85%"},{Source:"Metacritic",Value:"67\u002F100"}],item_lang:{data:{id:2238,attributes:{title:d,plot:"Sir Robert Chiltern is a successful Government minister, well-off and with a loving wife. All this is threatened when Mrs Cheveley appears in London with damning evidence of a past misdeed. Sir Robert turns for help to his friend Lord Goring, an apparently idle philanderer and the despair of his father. Goring knows the lady of old, and, for him, takes the whole thing pretty seriously.",slug:"an-ideal-husband"}}},books:{data:[{id:8238,attributes:{title:"An Ideal Husband a Play - Oscar Wilde",description:"An Ideal Husband revolves around a blackmail scheme that forces a married couple to reexamine their moral standards - providing, along the way, a wry commentary on the rarity of politicians who can claim to be ethically pure. A supporting cast of young lovers, society matrons, an overbearing father, and a formidable femme fatale continually exchange sparkling repartee, keeping the play moving at a lively pace.Like most of Wilde's plays, this scintillating drawing-room comedy is wise, well-constructed, and deeply satisfying. An instant success at its 1895 debut, the play continues to delight audiences over one hundred years later. An Ideal Husband is a must-read for Wilde fans, students of English literature, and anyone delighted by wit, urbanity, and timeless sophistication",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=R60GzgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"2020-10-15",publisher:a,subtitle:"Classic Edition"}},{id:8239,attributes:{title:d,description:"Although Oscar Wilde (1854–1900) created a wide range of poetry, essays, and fairy tales (and one novel) in his brief, tragic life, he is perhaps best known as a dramatist. His witty, clever drama, populated by brilliant talkers skilled in the art of riposte and paradox, are still staples of the theatrical repertoire. An Ideal Husband revolves around a blackmail scheme that forces a married couple to reexamine their moral standards — providing, along the way, a wry commentary on the rarity of politicians who can claim to be ethically pure. A supporting cast of young lovers, society matrons, an overbearing father, and a formidable femme fatale continually exchange sparkling repartee, keeping the play moving at a lively pace. ike most of Wilde's plays, this scintillating drawing-room comedy is wise, well-constructed, and deeply satisfying. An instant success at its 1895 debut, the play continues to delight audiences over one hundred years later. An Ideal Husband is a must-read for Wilde fans, students of English literature, and anyone delighted by wit, urbanity, and timeless sophistication.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=MapWGG3WJQgC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:"2001-02-01",publisher:"Courier Corporation",subtitle:a}},{id:8240,attributes:{title:d,description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=taA_DgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:"1928-01-01",publisher:"Prabhat Prakashan",subtitle:"A Play by Oscar Wilde"}},{id:8241,attributes:{title:d,description:"One of Wilde's most successful and most frequently revived plays, An Ideal Husband has divided critics more than any other. Treating political intrigue, financial fraud, blackmail, scandal and spin, and the role of women in public life, it is a play which engaged with issues of vital importance to its late-Victorian audience, which continue to resonate today.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=0ScQAgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:"2013-12-12",publisher:"A&C Black",subtitle:"Second Edition, Revised"}},{id:8242,attributes:{title:"The Plays of Oscar Wilde",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=7HYWAAAAYAAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:"1905-01-01",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1681377320228}}("","Oscar Wilde","movie","An Ideal Husband",null,"series",1))